import { ProductContaxt } from "./ProductProvider"

function Product() {
    const contaxt = useContext(ProductContaxt)
    // console.log(contaxt);
    return (
        <div>
            <h1>{contaxt.title}</h1>
            <p>{contaxt.para}</p>
           
        </div>
    )
}
export default Product
